import './App.css';
import ShowCustomers from './Comp/showCustomers'
import ShowProducts from './Comp/showProducts'
import ShowCategories from './Comp/showCategories'
import Nav from './Comp/Nav';
import FormPage from './Components/SignUp';
import SignIn from './Components/SignIn';
import BasicTable from './Comp/Home';





function App() {

  return (

    <div className="App">
      <header className="App-header">
        <BasicTable></BasicTable>
      <Nav></Nav>
      <ShowCustomers></ShowCustomers>
      <ShowCategories></ShowCategories>
      <ShowProducts></ShowProducts>

      </header>
    </div>
  );
}

export default App;
